public char getHexDigit(int p) {
  byte digit = getByte(p / 2);
  if (p % 2 == 0) {
    digit >>>= 4;
  }
  digit &= 0xf;
  if (digit < 10) {
    return (char) ('0' + digit);
  } else {
    return (char) ('A' + digit - 10);
  }
}

